css:
/*
  Override `language-css` invalid identifier rule:
  https://github.com/atom/language-css/blob/14aece2451497e21b08934bbf376c45e983422f0/grammars/css.cson#L1757
  for FB CSS namespaces to not syntax highlight it as invalid code:
  https://github.com/atom/language-css/issues/104#issuecomment-282292438
*/
.syntax--invalid.syntax--illegal.syntax--bad-identifier.syntax--css {
  background-color: transparent !important;
  color: inherit !important;
}
/* temporary fix for https://github.com/atom/autocomplete-plus/issues/860, which affects Atom 1.17+ */
autocomplete-suggestion-list .left-label.left-label {
  max-width: 10vw;
}
